import React from 'react';

const Header: React.FC = () => {
  return (
    <header className="h-16 bg-white border-b border-gray-200 flex justify-end items-center px-6">
      <div className="user-avatar cursor-pointer">
        <img src="/user-avatar.png" alt="User Avatar" className="w-10 h-10 rounded-full" />
      </div>
    </header>
  );
};

export default Header;
